import GoogleMapReact from 'google-map-react'
import Polygon from 'google-map-react'
import React from 'react'


import './map.scss'



const Map = ({center, zoom}) => {


    const paths = [
        { lat: 25.774, lng: -80.19 },
        { lat: 18.466, lng: -66.118 },
        { lat: 32.321, lng: -64.757 },
        { lat: 25.774, lng: -80.19 },
    ];
    const options = {
        strokeColor: "#FF0000",
        strokeOpacity: 0.8,
        strokeWeight: 2,
        fillColor: "#FF0000",
        fillOpacity: 0.35,
    };

    const onLoad = polygon => {
        console.log("polygon: ", polygon);
    }


    return (
        <div className='map'>
                <GoogleMapReact
                    bootstrapURLKeys={{key: 'AIzaSyBYEey3dAT7X6YcANl4oNHBa5V-4KS2cGA'}}
                    defaultCenter={center}
                    defaultZoom={zoom}
                >
                </GoogleMapReact>

                <Polygon
                    paths={paths}
                    options={options}
                    onload = {onLoad}
                />
        </div>
    );
}

Map.defaultProps = {
    center: {
        // lat: 55.7522200,
        // lng: 37.6155600,
        lat: 24.886, lng: -70.268
    },

    zoom: 5,
}

export default Map;
